import linkdin from "../Img/ldin.png";
export default function Footer() {
  return (
    <div
      className="footer d__flex align__items__center justify__content__space__between pz-10"
      style={{ padding: "10px 20px", zIndex: "100", backgroundColor: "#191919"}}
    >
      <span
        className="copyright"
        style={{ color: "#c6c9d8", fontSize: "14px", opacity: "0.75" }}
      >
        Copyright Â© 2021 Designed and Built by Lokesh Singh.
        <a href="https://github.com/lokesh15mca">
          <img
            src={git_logo}
            alt="no-img"
            className="footer__img pointer"
            style={{ height: "20px" }}
          />
        </a>
        <a href="https://www.linkedin.com/in/lokesh-singh-4bb1b6126/">
          <img
            src={linkdin}
            alt=""
            className="footer__img pointer"
            style={{ height: "20px" }}
          />
        </a>
      </span>
    </div>
  );
}
